(function($){'use strict';$(".experience-navigation li").on("click",function(){$(".experience-navigation li").removeClass("active");$(this).addClass("active");if(!$(this).attr("data-filter")){$(".experience-chart > li").fadeIn();}else{const filters=$(this).attr("data-filter").split(",").map(s=>s.trim());$(".experience-chart > li").each((index,li)=>{const dataCategoryArray=$(li).attr("data-category");const dataCategories=dataCategoryArray.substring(1,dataCategoryArray.length-1).split(" ");console.log(dataCategories.filter(value=>filters.includes(value)),dataCategories,filters);if(dataCategories.find(value=>filters.includes(value))){$(li).fadeIn();}else{$(li).fadeOut();}});}});$(".experience-chart li").on("click",function(){const id=$(this).attr("experience-id");const isCollapsed=!$(this).hasClass("extended");if(!isCollapsed){$(`#experience_${id} .details`).slideUp();$(this).removeClass("extended");$(`#experience_${id} .less_info`).hide();$(`#experience_${id} .more_info`).show();}else{$(`#experience_${id} .details`).slideDown();$(this).addClass("extended");$(`#experience_${id} .more_info`).hide();$(`#experience_${id} .less_info`).show();}});$("#experience-expand-all").on("click",function(){const collapsedExperience=$(".experience-chart > li:not(.extended)");if(collapsedExperience.length){$(`.experience-item .details`).slideDown();$(`.experience-item`).addClass("extended");$(`.experience-item .more_info`).hide();$(`.experience-item .less_info`).show();}else{$(`.experience-item .details`).slideUp();$(`.experience-item`).removeClass("extended");$(`.experience-item .less_info`).hide();$(`.experience-item .more_info`).show();}});}(jQuery));